    "importlib-metadata>=0.12; python_version < \"3.8\"",
]

[[package]]
name = "py"
version = "1.11.0"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
